import { HYDRATE } from "next-redux-wrapper";

const initalState = {
    user: {

    },
    post: {

    }
};



const rootReducer = (state =initalState, action)=>{
    switch(action.type) {
        case HYDRATE:
            return  {...state, ...action.payload };

        default:
            return state;
    }
};

export default rootReducer
